/*!

=========================================================
* Light Bootstrap Dashboard React - v2.0.1
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2022 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import Dashboard from "views/Dashboard.js";
import DashboardEnterprise from "views/pages/enterprises/DashboardEnterprise";
import DashboardUser from "views/pages/users/DashboardUser.js"
import UserProfile from "views/pages/users/UserProfile.js";
import TableList from "views/TableList.js";

import Icons from "views/Icons.js";

const dashboardRoutes = [

  {
    path: "/dashboard",
    name: "Administração",
    icon: "nc-icon nc-chart-pie-35",
    component: Dashboard,
    layout: "/admin"
  },

  //ROTAS DE EMPRESA

  //Rotas de USUARIOS
  {
    path: "/user",
    name: "Usuários",
    icon: "nc-icon nc-circle-09",
    component: DashboardUser,
    layout: "/admin"
  },
  {
    path: "/view/user",   
    component: UserProfile,
    layout: "/admin"
  },

  //ROTAS DE CLIENTES
  {
    path: "/table",
    name: "Importar Planilha",
    icon: "nc-icon nc-notes",
    component: TableList,
    layout: "/admin"
   },

  {
    path: "/icons",
    name: "Icons",
    icon: "nc-icon nc-atom",
    component: Icons,
    layout: "/admin"
  }

];

export default dashboardRoutes;
